import React, { Component } from "react";

class BuyChoice extends Component {
  state = {};

  buySearchButtonClick = () => {
    window.location.href = "/buy";
  };

  addBuyButtonClick = () => {
    window.location.href = "/buy/choose";
  };
  render() {
    return <h1>Hello World</h1>;
  }
}

export default BuyChoice;
